import React from 'react'
import data from './data'

const Menu = () => {
  return (
    <div>{data.map =((onedata) => {
        const {id,folder_name} = onedata
        return <div key={id}>
            <p>{folder_name}</p>
        </div>
    })}</div>
  )
}

export default Menu
